import React from 'react';
import login from './components/login.js';
import {Container, Button, Form} from "react-bootstrap";

function App() {
  return (
    <>
    <Container style={{flex:1, flexDirection:'rows', alignItems:'center', justifyContent:'center',}}>
      <Form style={{}}>

      <item last>
        <input placeholder='Username' 
          style={{color:'white'}}/>
        </item>
        <item last>
            <input placeholder="Password"
            style={{color:'white'}} />
        </item>
      <Button style={{width:70,backgroundColor:'#99004d',marginTop:20,}}>
        <text style={{marginLeft:10}}>Login</text>
      </Button>

      </Form>

    </Container>
    
    
    </>
  )
}


export default App;
